return items
  .filter(item => {
    const data = item.json;

    const isPersonal = data.type === 'personal';
    const hasName = data.first_name && data.last_name;
    const hasPosition = data.position || data.position_raw;
    const hasLinkedIn = !!data.linkedin;

    // Combine both position and position_raw for keyword matching
    const positionText = `${data.position || ''} ${data.position_raw || ''}`.toLowerCase();

    // Keywords for decision-maker roles
    // const decisionMakerKeywords = [
    //   'ceo', 'cto', 'cfo', 'coo', 'cmo', 'cxo',
    //   'founder', 'owner', 'director', 'partner',
    //   'investor', 'president', 'vp', 'chief',
    //   'managing', 'chairman', 'principal'
    // ];

    // const isDecisionMaker = decisionMakerKeywords.some(keyword => positionText.includes(keyword));

    return isPersonal && hasName && hasLinkedIn;
    // return true
  })
  .map(item => {
    const email = item.json.value;
    const domain = email.split("@")[1] || "unknown";

    return {
      json: {
        fullName: `${item.json.first_name} ${item.json.last_name}`,
        email: email,
        position: item.json.position,
        linkedin: item.json.linkedin,
        domain: domain,
        phone_number: item.json.phone_number || null,
        location: item.json.location || null,
        hunter_confidence: item.json.confidence,
        linkedin_connection_status: "Not Connected",
      }
    };
  });

return items.map(item => {
  const fields = item.json;

  // Merge all field values into one string
  const mergedData = Object.entries(fields)
    .map(([key, value]) => `${key}: ${value}`)
    .join(', ');

  return {
    json: {
      data: mergedData
    }
  };
});
